                    // }
                    // else if (route.name === 'MedaillonContests') {
                    //     iconName = focused ? "home" : "home";
                    // }

                    if (route.name === 'Home') {
                        if (focused) {
                            return <Foundation name="home" size={30} color="white" />
                        } else {
                            return <Octicons name="home" size={24} color="white" />
                        }
                    } else if (route.name === 'Search') {
                        if (focused) {
                            return <FontAwesome name="search" size={size} color="white" />
                        } else {
                            return <Feather name="search" size={size} color="white" />
                        }
                    } else if (route.name === 'Shop') {
                        if (focused) {
                            return <MaterialCommunityIcons name="shopping" size={24} color="white" />
                        } else {
                            return <MaterialCommunityIcons name="shopping-outline" size={24} color="white" />
                        }
                    } else if (route.name === 'Medaillon') {
                        if (focused) {
                            return <Image
                                style={{ width: 35, height: 35 }}
                                source={{
                                    uri: 'data:image/png;base64,'
                                }}
                            />
                        } else {
                            return <Image
                                style={{ width: 35, height: 35 }}
                                source={{
                                    uri: 'data:image/png;base64,'
                                }}
                            />
                        }
                    } else if (route.name === 'Reels') {
                        if (!focused) {
                            size = size - 2;
                        }
                        return (
                            <Image
                                style={{ width: size, height: size }}
                                source={{
                                    uri:
                                        'data:image/png;base64,',
                                }}
                            />
                        );
                    } else if (route.name === 'Profile') {
                        size = size + 5;
                        if (focused) {
                            // size = size + 6;
                            return (
                                // <FontAwesome name="user" size={24} color="black" />
                                <FontAwesome5 name="user-alt" size={24} color="white" />
                            );
                        }
                        return (
                            // <FontAwesome name="user-o" size={24} color="black" />
                            <FontAwesome5 name="user" size={24} color="white" />
                        );
                    } else if (route.name === 'Messages') {
                        size = size + 5;
                        if (focused) {
                            size = size + 6;
                        }
                        return (

                            <AntDesign name='message1' color={'white'} size={24} />
                        );
                    }

                    // else if (route.name === 'MedaillonContests') {
                    //     if (iconName = focused) {
                    //         return <Octicons name="home" size={size} color={color} />
                    //     } else {
                    //         return <Foundation name={iconName} size={size} color={color} />
                    //     }
                    // }
